import React from 'react'

function ContentPart(props) {
    const x=props.values;
    let val;
    if(x=="About"){
        val=(<div>
            <h1>I'm Anantha Ramu</h1><br/>
            <h2>I'm a Full Stack Developer</h2><br/>
            <h3>I'm currently pursuing my Bachelor's Degree in Computer Science</h3>

        </div>);
    }
    else
  return (
    <div className='bodypart'>
      {val}
    </div>
  )
}

export default ContentPart
